import React, { useState, useEffect } from 'react';
import { Link, useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

const OneHome = () => {
    const [workout, setWorkout] = useState({});
    const { id } = useParams();
    const navigate = useNavigate();

    //Delete
    const handleDelete = (event) => {
        axios.delete(`http://localhost:3000/api/v1/workouts/${event.target.value}`)
        .then((response) =>{
            console.log(response);
            navigate('/workouts')
        })
        };

    //rendering data
    useEffect(() => {
        axios
        .get(`http://localhost:3000/api/v1workouts/${id}`)
        .then((response) => {
            setWorkout(response.data);
        })
        .catch((error) => {
            console.log(error);
        });
    }, [id]);

    return (
        <>
            <div className='sm:flex justify-around h-11/12 sm:w-11/12 ml-auto mr-auto sm:mt-10'>
                <div className=' h-90 sm:w-2/5 w-full sm:border-solid sm:border-2 p-2'>
                    <div className='flex justify-between border-b-4'>
                        <div>
                            <h2 className='text-2xl font-bold'>{workout.name}</h2>
                        </div>
                        <div>
                            <p className='tracking-wider mr-5'><Link to={`/update/${workout.id}`} className='text-blue-500'>Edit</Link> || <button onClick={handleDelete} value={workout.id} className='text-red-500'>Delete</button></p>
                        </div>
                    </div>
                    <div className='flex justify-between mr-5 mt-8 '>
                        <div>
                            <h2 className='font-semibold'>${workout.name}</h2>
                        </div>
                    </div>
                    <div className='mt-8 text-center '>
                        <p className='tracking-tight'>{workout.date}</p>
                    </div>
                    <div className='mt-8 text-center '>
                        <p className='tracking-tight'>{workout.time}</p>
                    </div>
                    <div className='mt-8 text-center '>
                        <p className='tracking-tight'>{workout.duration}</p>
                    </div>
                    <div className='mt-8 text-center '>
                        <p className='tracking-tight'>{workout.difficulty}</p>
                    </div>
                    <div className='mt-8 text-center '>
                        <p className='tracking-tight'>{workout.exercises}</p>
                    </div>
                    <div className='mt-20 text-center'>
                        <p>{workout.notes}</p>
                    </div>
                </div>
            </div>
        </>
    );
};

export default OneHome;
